      ''Kwargs'', ''type'': ''object''}}\nTool Name: Ask question to coworker(question:
      str, context: str, coworker: Optional[str] = None, **kwargs)\nTool Description:
      Ask a specific question to one of the following coworkers: Researcher, Senior
      Writer\nThe input to this tool should be the coworker, the question you have
